(261, 90, 0, 65052, '', 1, NULL, '2023-06-27 08:45:51', 90, 'ru', 18, 1, 'Надувная байдарка(каяк) BestWay  65052', 'Надувная байдарка(каяк) BestWay ', '0.00', NULL, '<div align=\"justify\">\r\n<ul>\n<li>кол-во посадочных мест,чел - 2</li>\r\n<li>материал лодки многослойный ПВХ армированный нейлоном устойчивый к воздействию бензина, масел, соленой воды, к механическим повреждениям</li>\r\n<li>корпус лодки состоит из двух независимых боковых бортов-камер</li>\r\n<li>надувной пол</li>\r\n<li>держатели для весел</li>\r\n<li>съемная сумка для вещей,</li>\r\n<li>качественные ввинчивающиеся клапана для быстрого накачивания и спуска воздуха,</li>\r\n<li>каркасный леерный трос с встроенными втулками,</li>\r\n<li>дренажный клапан,</li>\r\n<li>картонная упаковка</li>\r\n<li>размер упаковки, см -- 79 х 63 х 26</li>\r\n<li>Надутый Размер: 330 см x 94 см</li>\r\n<li>Сдутый, Размер: 90 см x 40 см x 24 см</li>\r\n<li>Толщина  ПВХ 0.6/0.40 mm (24.0/16.0 ga.)</li>\r\n<li>Грузоподъёмность: 200 кг</li>\r\n<li>Вес: 18.4 кг</li>\r\n</ul>\n<p> <strong>Комплектация</strong>:</p>\r\n<ul>\n<li>Два алюминиевых двухлопастных разборных весла длиной 254 см</li>\r\n<li>Воздушный ручной насос  Hammer™ (#62029) 40 см (16”)</li>\r\n<li>Два регулируемых кресла с отсеками для хранения</li>\r\n<li>Чехол из прочной ткани (нейлон) для дополнительной защиты лодки</li>\r\n<li>Сумка для переноски</li>\r\n<li>Ремкомплект  </li>\r\n<li>    Любители рыбалки и водных путешествий оценят надувные лодки от компании BestWay, отличающиеся высочайшим качеством и разнообразием ассортимента. Надувные лодки BestWay (БестВей) разработаны специальным образом, чтобы в сложенном виде занимать как можно меньше пространства, максимально быстро готовиться к эксплуатации и быть удобными и комфортными для пассажиров. Все модели надувных лодок продаются с удобными чехлами, которые занимают немного места в багажнике автомобиля, или же могут переноситься как наплечный рюкзак. В зависимости от потребностей доступны модели с одним, двумя, тремя и даже четырьмя посадочными местами.</li>\r\n</ul>\n<p>    Надувные лодки БестВей комплектуются легкими и компактными веслами, изготовленными из пластика или алюминия. Материал надувных лодок экологичен и полностью безопасен в эксплуатации, а также достаточно надежен даже при использовании в неспокойных водоемах. Конструкция надувных лодок позволяет устанавливать бензиновые или же аккумуляторные двигатели. Подготовка даже самой крупногабаритной надувной лодки BestWay к спуску на воду займет не более 20 минут.</p>\r\n</div>', NULL, NULL, 0, 'gasaberi kaiaki BestWay ', '', 0, 0, '/files/გასაბერი_კაიაკი.jpeg', '/files/გასაბერი_კაიაკი_4.jpg', '/files/გასაბერი_კაიაკი_5.jpg', '/files/გასაბერი_კაიაკი_6.jpg', '/files/გასაბერი_კაიაკი_7.jpg', '/files/გასაბერი_კაიაკი_8.jpg', 0, NULL, NULL, 0, NULL),
