(264, 91, 0, 60021, '', 1, NULL, '2023-06-27 08:45:51', 91, 'ru', 8, 1, 'Надувной Spa бассейн BestWay  Lay Z Spa Hawaii AirJet 60021', 'Надувной Spa бассейн BestWay  Lay Z Spa Hawaii AirJet', '2990.00', NULL, '<div class=\"tb_block\" style=\"position: static; padding-top: 7px; margin: 0px 0px 7px;\">\r\n<p style=\"text-indent: 0px; margin: 0px 0px 7px;\">Внутренний диаметр: 130 см<br>Общий вес (с водой): 879 кг</p>\r\n</div>\r\n<p><strong class=\"h2 panel\">Описание:</strong></p>\r\n<div class=\"tb_block\" style=\"position: static; padding-top: 7px; margin: 0px 0px 7px;\">Производитель Bestway представляет вашему вниманию надувной СПА бассейн (джакузи) Lay-Z-Spa Hawaii AirJet. Данная модель мобильна и практична для домашнего использования. Например, вы можете расположить бассейн во дворе частного дома или в больших помещениях с влагоустойчивой облицовкой. Для комфортного купания имеется подогрев воды до 40°C, функция фильтрации и джакузи. На ЖК-дисплее наглядно отображаются рабочие параметры. С помощью таймера можно задавать удобное время запуска программ. Приобрести СПА бассейн от компании Bestway, вы можете в нашем интернет-магазине для расслабляющего отдыха в кругу семьи и друзей.</div>\r\n<p><strong class=\"h2 panel\">Особенности:</strong></p>\r\n<div class=\"tb_block\" style=\"position: static; padding-top: 7px; margin: 0px 0px 7px;\">• Рассчитан на 4-6 человек<br>• Массажная система<br>• Удобная система управления<br>• Утепленный пол со сливом<br>• Воздушные форсунки<br>• Встроенный водонагреватель и фильтр насоса<br>• Компактное хранение</div>\r\n<div class=\"complectation\" style=\"position: static; margin: 0px 0px 7px;\">\n<strong>Комплектация:</strong>\r\n<ul style=\"margin-top: 10px; padding-left: 15px;\"><ul style=\"margin-top: 10px; padding-left: 15px;\">\n<li style=\"margin-bottom: 3px; color: #000000; font-family: Tahoma, sans-serif; font-size: 11px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; lette