(270, 93, 0, 62023, '', 1, NULL, '2023-06-27 08:45:51', 93, 'ru', 22, 1, 'Ножной насос BestWay  Air Step Air Pump 62023', 'Ножной насос BestWay  Air Step Air Pump', '21.00', NULL, '<p>Bestway 62023 воздушный ножной насос \"лягушка\", объемом 5 литров, предназначен для накачивания надувных кроватей, матрасов и других изделий фирм Intex, Sevylor и BestWay. Емкость насоса Bestway 62023 позволит вам легко накачать практически любую надувную кровать или матрас. Также Bestway 62023 насос подойдёт для накачивания фитболов. Насос \"лягушка\" не зависит от наличия рядом электросети, что делает его практически незаменимым в походах и на пикниках.<br>Характеристики Bestway 62023:<br>Производитель: BestWay<br>Особенности Бествей: с гибким шлангом<br>Производительность: 350 л/час<br>Размеры:23x15см<br>Вес: 1 kg</p>', NULL, NULL, 0, 'fekhis tumbo BestWay  Air Step Air Pump', '', 0, 0, '/files/ფეხის_ტუმბო_BestWay_62023_Air_Step-Air_Pump_1.jpg', '/files/ფეხის_ტუმბო_BestWay_62023_Air_Step-Air_Pump_2.jpg', '/files/ფეხის_ტუმბო_BestWay_62023_Air_Step-Air_Pump_3.jpg', '/files/ფეხის_ტუმბო_BestWay_62023_Air_Step-Air_Pump_4.jpg', '/files/ფეხის_ტუმბო_BestWay_62023_Air_Step-Air_Pump_5.jpg', '', 0, NULL, NULL, 0, NULL),
(271, 94, 0, 62008, '', 1, NULL, '2023-06-27 08:45:51', 94, 'ge', 22, 1, 'ხელის მოხმარების ჰაერის ტუმბო BestWay  Mini Air Hammer Inflation Pump 62008', 'ხელის მოხმარების ჰაერის ტუმბო BestWay  Mini Air Hammer Inflation Pump', '7.00', NULL, '<p>• ზომა:  28სმ x 5,5სმ<br><span id=\"selection_index6\" class=\"selection_index\"></span>• მასალა: პლასტმასი<br><span id=\"selection_index7\" class=\"selection_index\"></span>• სიმძლავრე: 500 კუბ.სმ; <br>• ფერ: ლურჯი და ყვითელი<br><span id=\"selection_index7\" class=\"selection_index\"></span></p>', NULL, NULL, 0, 'khelis mokhmarebis haeris tumbo BestWay  Mini Air Hammer Inflation Pump', '', 0, 0, '/files/ხელის_მოხმარების_ჰაერის_ტუმბო_BestWay_62008_Mini_Air_Hammer-Inflation_Pump.jpg', '/files/ხელის_მოხმარების_ჰაერის_ტუმბო_BestWay_62008_Mini_Air_Hammer-Inflation_Pump_1.jpg', '/files/ხელის_მოხმარების_ჰაერის_ტუმბო_BestWay_62008_Mini_Air_Hammer-Inflation_Pump_2.jpg', '', '', '', 0, NULL, NULL, 0, NULL),
