(273, 94, 0, 62008, '', 1, NULL, '2023-06-27 08:45:51', 94, 'ru', 22, 1, 'Ручной насос BestWay  Mini Air Hammer Inflation Pump 62008', 'Ручной насос BestWay  Mini Air Hammer Inflation Pump', '7.00', NULL, '<p>Насос ручной Bestway 62008 необходим для накачивания надувных мячей, матрасов, кругов, мячей и надувных игрушек. Насос прост и удобен в использовании. Насос ручной \"Bestway\" надувает при движении вверх-вниз.</p>\r\n<div> </div>\r\n<div><strong>Цвет Насос ручной BestWay 62008:</strong></div>\r\n<div>желтый, синий</div>\r\n<div> </div>\r\n<div><strong>Технические характеристики Насос ручной BestWay 62008:</strong></div>\r\n<div>Изготовлен из пластика. </div>\r\n<div>Объем воздуха: 2х500 куб.см. </div>\r\n<div>Размер насоса: 28x5.5 см.</div>\r\n<p>Диаметр отверстия: 7 мм.</p>', NULL, NULL, 0, 'khelis mokhmarebis haeris tumbo BestWay  Mini Air Hammer Inflation Pump', '', 0, 0, '/files/ხელის_მოხმარების_ჰაერის_ტუმბო_BestWay_62008_Mini_Air_Hammer-Inflation_Pump.jpg', '/files/ხელის_მოხმარების_ჰაერის_ტუმბო_BestWay_62008_Mini_Air_Hammer-Inflation_Pump_1.jpg', '/files/ხელის_მოხმარების_ჰაერის_ტუმბო_BestWay_62008_Mini_Air_Hammer-Inflation_Pump_2.jpg', '', '', '', 0, NULL, NULL, 0, NULL),
