(276, 95, 0, 62007, '', 1, NULL, '2023-06-27 08:45:51', 95, 'ru', 22, 1, 'Ножной насос BestWay  Air Step Air Pump 62007', 'Ножной насос BestWay  Air Step Air Pump', '7.00', NULL, '<p>Универсальный ножной насос от Bestway служит для накачивания большинства надувных игрушек, мячей, матрасов и лодок. Он обладает высокой скоростью надувания и сдувания, оснащен гибким шлангом и тремя переходниками, которые подходят почти к любому клапану. Конструкция представленной модели насоса обеспечивает максимальный воздушный поток, а также удобство и простоту в применении.</p>\r\n<p><strong>Характеристики:</strong></p>\r\n<ul type=\"disc\">\n<li>Ножной;</li>\r\n<li>Материал: пластик;</li>\r\n<li>Объем воздушной камеры: 500 куб.см;</li>\r\n<li>Размер насоса: 11х13x9,5 см;</li>\r\n<li>Длина шланга: 73 см.</li>\r\n</ul>\n<p><strong>Производитель:</strong> Bestway.</p>', NULL, NULL, 0, 'fekhis mtsire tumbo BestWay  Air Step Air Pump', '', 0, 0, '/files/ფეხის_მცირე_ტუმბო_BestWay_62007_Air_Step-Air_Pump.jpg', '/files/ფეხის_მცირე_ტუმბო_BestWay_62007_Air_Step-Air_Pump_1.jpg', '/files/ფეხის_მცირე_ტუმბო_BestWay_62007_Air_Step-Air_Pump_2.jpg', '', '', '', 0, NULL, NULL, 0, NULL),
