(313, 108, 0, 67442, '', 1, NULL, '2023-06-27 08:45:51', 108, 'ge', 2, 1, 'გასაბერი ლოგინი BestWay  67442', 'გასაბერი ლოგინი BestWay ', '129.00', NULL, '<p>▷ გასაბერი ლეიბი Bestway-სგან.</p>\r\n<p>▷ აღწერილობა:</p>\r\n<p>• ზომა:203 X 102 X 38სმ</p>\r\n<p>• მასალა: PVC</p>\r\n<p>• მყარი კონსტუქცია</p>\r\n<p>• ბუსუსებიანი ზედაპირი, კონფორტული დასვენებისათვის.</p>\r\n<p>• ჩამონტაჟებული ელექტრო ტუმბო, სწრაფი გაბერვისა და გამოტუმბისათვის</p>\r\n<p>• ელექტრო ტუმბო მუშაობს 220-240 v.</p>\r\n<p>• დამატებითი მასალა შესაკეთებლად</p>\r\n<p>• ლამაზი ჩანთა ლეიბის შესანახად</p>\r\n<p>• შეფუთვის სიმაღლე-41სმ.</p>\r\n<p>    თუ თქვენ ქსურთ კომფორტული დასვენება სახლში, აგარაკზე ან ბუნებაში, გასაბერი ლეიბები BESTWAY-გან არის ბრწინვალე არჩევანი. ხასიათიდან და გემოვნებიდან გამომდინარე თქვენ შეგიძლიათ შეარჩიოთ ნებისმიერი ფერის , ზომის ან ფორმის ლეიბი. ყველა პროდუქტს რომელსაც თქვენ შეარჩევთ ჩვენს მაღაზიაში მინიჭებული აქვს ISO-9001 სერტიფიკატი.</p>', NULL, NULL, 0, 'gasaberi logini BestWay ', '', 0, 0, '/files/გასაბერი_ლოგინი_BestWay_67442_4.jpg', '/files/გასაბერი_ლოგინი_BestWay_67442_1.jpg', '/files/გასაბერი_ლოგინი_BestWay_67442_2.jpg', '/files/გასაბერი_ლოგინი_BestWay_67442.JPG', '/files/გასაბერი_ლოგინი_BestWay_67442_3.jpg', '', 0, NULL, NULL, 0, NULL),
