(315, 108, 0, 67442, '', 1, NULL, '2023-06-27 08:45:51', 108, 'ru', 2, 1, 'Надуввная кровать BestWay  67442', 'Надуввная кровать BestWay ', '129.00', NULL, '<div>\r\n<p><em>Bestway 67442 </em>изготовлена из прочных материалов и проста в использовании. Уникальная конструкция матраца со встроенным подголовником создаёт прекрасные условия для отдыха. Благодаря флокированному покрытию Bestway 67442 простыни не соскальзывают с поверхности. Дополнительным преимуществом модели <span style=\"text-decoration: underline;\">Bestway 67442</span> является встроенный электрический насос, который позволяет быстро надуть или сдуть изделие. Матрац легко моется, а в собранном виде не занимает много места. Благодаря нейтральной цветовой палитре, <em><strong>Bestway 67442</strong></em> прекрасно сочетается с любой мебелью.</p>\r\n<h3>Характеристики Bestway 67442:</h3>\r\n</div>\r\n<ul>\n<li><span class=\"views-field views-field-body\"><span class=\"field-content\">Цвет: Тёмно-синий , светло-серый</span></span></li>\r\n<li><span class=\"views-field views-field-body\"><span class=\"field-content\">Насос: встроенный 220 V</span></span></li>\r\n<li>Материал: ПВХ с флокированным покрытием</li>\r\n<li>\n<span class=\"views-field views-field-body\"><span class=\"field-content\">Максимальная нагрузка: вес в 295 </span></span>кг.</li>\r\n<li>В комплект входит: надувная кровать со встроенным электрическим насосом, сумка.</li>\r\n</ul>\n<div class=\"views-field views-field-field-size\">\n<span class=\"views-label views-label-field-size\">Размеры: </span>203 x 152 x 38 см</div>\r\n<div class=\"views-field views-field-weight\">\n<span class=\"views-label views-label-weight\">Вес: </span> <span class=\"field-content\">7 kg</span>\n</div>', NULL, NULL, 0, 'gasaberi logini BestWay ', '', 0, 0, '/files/გასაბერი_ლოგინი_BestWay_67442_4.jpg', '/files/გასაბერი_ლოგინი_BestWay_67442_1.jpg', '/files/გასაბერი_ლოგინი_BestWay_67442_2.jpg', '/files/გასაბერი_ლოგინი_BestWay_67442.JPG', '/files/გასაბერი_ლოგინი_BestWay_67442_3.jpg', '', 0, NULL, NULL, 0, NULL),
