(324, 111, 0, 60001, '', 1, NULL, '2023-06-27 08:45:51', 111, 'ru', 8, 1, 'Надувной Spa бассейн BestWay  Miami AirJet 60001', 'Надувной Spa бассейн BestWay  Miami AirJet', '1900.00', NULL, '<p>          Популярная новинка производителя Bestway. Надувной SPA бассейн для домашнего использования. Обеспечивает возможность релаксации 1-4 человек в теплой, приятной воде. Оснащен массажной системой Lay-Z-Spa’s AirJets. Рассчитан на установку как на улице, так и в помещении. Комфорт, надежность и отменная эргономика по доступной цене. Идеальное решение для отдыха семьей или компанией. </p>\r\n<ul class=\"bullet\">\n<li>Вместимость бассейна: до 4 человек</li>\r\n<li>Объем бассейна (90%): 900 литров</li>\r\n<li>Скорость нагрева: 1,5-2 град/час</li>\r\n<li>Максимальная температура воды: +40С</li>\r\n<li>Кол-во форсунок: 81 аэрофорсунка</li>\r\n<li><span style=\"color: #292929; font-family: Roboto, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Массажная система LAY–Z–SPA</span></li>\r\n<li><span style=\"color: #292929; font-family: Roboto, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"><span style=\"color: #292929; font-family: Roboto, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: norm