(369, 126, 0, 75046, '', 1, NULL, '2023-06-27 08:45:51', 126, 'ru', 3, 1, 'Надувное кресло BestWay  Comfi Cube 75046', 'Надувное кресло BestWay  Comfi Cube', '39.00', NULL, '<p>Надувное кресло ComfiCube изготовлено из прочного винила. Верхняя поверхность кресла флокирована, материал на ощупь напоминает велюр. Флок не пропускает воду, легко чистится без применения специальных средств. Дно кресла усилено слоем ламинированного стекловолокна для защиты от проколов.</p>\r\n<p>Кресло имеет универсальный клапан для накачивания и сдувания – подойдет любой тип насоса: ручной, ножной, электрический насос приобретается отдельно. В комплект входит специализированная самоклеющаяся заплатка для ремонта.</p>\r\n<p><strong>Характеристики</strong></p>\r\n<ul>\n<li>Возраст от 3 лет</li>\r\n<li>Размер 74х74х64 см.</li>\r\n<li>Макс. нагрузка: до 100 кг.</li>\r\n<li>Материал: Винил</li>\r\n<li>Флокирование: Да</li>\r\n<li>Три цвета на выбор: красный, оранжевый, синий</li>\r\n<li>В комплекте: заплатка для ремонта</li>\r\n<li>Насос приобретается отдельно</li>\r\n<li>Размер упаковки: 13х31х37 см.</li>\r\n<li>Вес: 1,7 кг.</li>\r\n</ul>', NULL, NULL, 0, 'gasaberi-savardzeli-bestway-comfi-cube', NULL, 0, 0, '/files/გასაბერი_სავარძელი_BestWay_75046_Comfi_Cube_5.jpg', '/files/გასაბერი_სავარძელი_BestWay_75046_Comfi_Cube_6.jpg', '/files/გასაბერი_სავარძელი_BestWay_75046_Comfi_Cube_7.jpg', '/files/გასაბერი_სავარძელი_BestWay_75046_Comfi_Cube_8.jpg', '/files/გასაბერი_სავარძელი_BestWay_75046_Comfi_Cube_9.jpg', '/files/გასაბერი_სავარძელი_BestWay_75046_Comfi_Cube_10.jpg', 0, NULL, NULL, 0, NULL),
