(425, 145, 0, 62076, '', 1, NULL, '2023-06-27 08:45:51', 145, 'en', 22, 1, 'ელექტროტუმბო BestWay  62076', 'ელექტროტუმბო BestWay ', '59.00', NULL, '<p>• სიმძლავრე: 35W<br><span id=\"selection_index6\" class=\"selection_index\"></span>• სამუშაო ძაბვა: 12V/220V<br><span id=\"selection_index7\" class=\"selection_index\"></span>• გამოიყენება როგორც სახლში ასევე მოგზაურობის დროს<br>• მოჰყვება 3 თავაკი სხვადასხვა ზომის სარქველებისთვის<br><span id=\"selection_index6\" class=\"selection_index\"></span>• გამოიყენება ყველა ზომის ნივთის გასაბერად<br><span id=\"selection_index7\" class=\"selection_index\"></span>• ფუნქციები: დაბერვა/ამოტუმბვა<br>• ზომა: 14სმ x 11სმ x 12სმ<br>• წონა: 0,48კგ<br><span id=\"selection_index6\" class=\"selection_index\"></span>• ფერი: შავი</p>', NULL, NULL, 0, 'eleqtrotumbo BestWay ', '', 0, 0, '/files/ელექტროტუმბო_BestWay_62076___2.jpg', '/files/ელექტროტუმბო_BestWay_62076___3.jpg', '/files/ელექტროტუმბო_BestWay_62076___4.jpg', '/files/ელექტროტუმბო_BestWay_62076___5.jpg', '/files/ელექტროტუმბო_BestWay_62076___6.jpg', '', 0, NULL, NULL, 0, NULL),
(426, 145, 0, 62076, '', 1, NULL, '2023-06-27 08:45:51', 145, 'ru', 22, 1, 'Электрический насос BestWay  62076', 'Электрический насос BestWay ', '59.00', NULL, '<p>Работает от 220В и 12В, что делает этот насос незаменимым как дома, так и в поездке.<br>За небольшое время при его помощи Вы сможете наполнить надувную кровать или лодку воздухом и так же быстро их сдуть.<br>В комплекте 3 насадки - переходника, что позволяет использовать его для любых надувания изделий Intex<br><br>Насос Bestway 62076 универсал 12/220В пригодится и на природе и дома, а также вполне способен выручить и в дороге. Универсальный насос предназначен для наполнения воздухом различных надувных изделий, например кроватей, матрасов, лодок и т.д.<br><br>Насос Bestway 62076 универсал 12/220В представляет оптимальное решение 2 в 1, поскольку способен работать как от прикуривателя автомобиля (12 В), так и от обычной электросети (220 В).<br><br>Мощный универсальный электрический насос моментально наполняет воздухом даже большие кровати или матрасы. Для подсоединения воздушных клапанов разного размера насос Bestway 62076 универсал 12/220В комплектуется тремя насадками-переходниками разного диаметра.<br><br>Насос Bestway 62076 универсал 12/220В способен работать в двух режимах – надув воздуха и его откачивание, поэтому удобен как для наполнения воздухом изделий, так и для его спуска.</p>\r\n<p> </p>\r\n<p>Производитель: BestWay Dervelopment Co Ltd 9/F., Dah Sing Financial Centre,108 Glouceste Road, Wanchai<br>Страна производства: Китай</p>', NULL, NULL, 0, 'eleqtrotumbo BestWay ', '', 0, 0, '/files/ელექტროტუმბო_BestWay_62076___2.jpg', '/files/ელექტროტუმბო_BestWay_62076___3.jpg', '/files/ელექტროტუმბო_BestWay_62076___4.jpg', '/files/ელექტროტუმბო_BestWay_62076___5.jpg', '/files/ელექტროტუმბო_BestWay_62076___6.jpg', '', 0, NULL, NULL, 0, NULL),
