(441, 150, 0, 41070, '', 1, NULL, '2023-06-27 08:45:51', 150, 'ru', 12, 1, 'Надувной скутер с мотором BestWay  41070', 'Надувной скутер с мотором BestWay ', '170.00', NULL, '<p>   Надувной скутер с моторчиком BestWay 41070 – отличный подарок ребёнку на пятилетие. И мальчишки, и девчонки будут в восторге от такого макета взрослого скутера. Надувной спасательный жилет только прибавит маленьким седокам солидности. Яркий и красивый скутер БестВей 41070 – лучшее средство для выработки навыков управлением самоходным средством. Двигатель скутера работает от 8 батареек размера D в течение 1 часа. Предусмотрена возможность использовать аккумулятор на 12В. Максимальная скорость – 1,5 кмчас. Размеры скутера – 140 х 79 см. позволяют кататься детям весом до 45 кг. Весит надувное судно 6,2 кг., что позволяет брать его с собой на открытый водоем. Прилагается комплект для ремонта мелких проколов.</p>', NULL, NULL, 0, 'gasaberi eleqtro skuteri BestWay ', '', 0, 0, '/files/გასაბერი_ელექტრო_სკუტერი_BestWay_41070_JS-PRO_Racer.jpg', '/files/გასაბერი_ელექტრო_სკუტერი_BestWay_41070_JS-PRO_Racer_1.jpg', '/files/გასაბერი_ელექტრო_სკუტერი_BestWay_41070_JS-PRO_Racer_2.jpg', '/files/გასაბერი_ელექტრო_სკუტერი_BestWay_41070_JS-PRO_Racer_3.jpg', '/files/გასაბერი_ელექტრო_სკუტერი_BestWay_41070_JS-PRO_Racer_4.jpg', '', 0, NULL, NULL, 0, NULL),
