(467, 159, 0, 56574, '', 1, NULL, '2023-06-27 08:45:51', 159, 'ru', 6, 1, ' Стальной каркасный бассейн BestWay  56574', ' Стальной каркасный бассейн BestWay ', '3700.00', NULL, '<p>Каркасный бассейн Bestway 56574 - простая и недорогая конструкция.Вам не понадобятся специальные инструменты и бетонный фундамент, необходимые для стационарных бассейнов! Все, что вам нужно - это плоская, чистая горизонтальная площадка.<br>В любых погодных условиях супер прочная конструкция делает ненужной разборку бассейна в конце сезона(бассейн морозоустойчив).Но если потребуется,бассейн может быть легко разобран и собран заново.<br>Конструкция стенок состоит из гофрированной стали толщиной 0,4 мм., и комплекта :1)толстой виниловой чаши которая имеет специальное покрытие для защиты от УФ-излучения,2)удобной лестницы, которая позволяет легко и быстро забраться в бассейн а так же выбраться из него.Бассейн Bestway 56285 имеет широкую - 16 см - стальную раму по краю бассейна и интегрированный 3)скиммер для автоматической очистки поверхности воды.4)Фильтрующий песчаный насос производительностью 2006 л/ч.5)Имеется настил под бассейн который дает дополнительную защиту для дна.<br>Конструкция каркасного бассейна не имеет острых углов, что обеспечивает безопасную эксплуатацию.<br>Предусмотрен сливной клапан, который присоединяется к садовому шлангу.<br>     <br>Внимание!!!Фильтрующий элемент-Кварцевый песок в комплект не входит!!!                                                     </p>\r\n<ul>\n<li style=\"display: inline !important;\">Длина,см:366</li>\r\n<li>Ширина,см: 366</li>\r\n<li>Высота,см: 122</li>\r\n<li>Объем,л(90%): 10,990</li>\r\n<li>Каркас: металлические стойки</li>\r\n<li>Стенки: гофрированная сталь толщиной: 0,4 мм</li>\r\n<li>Чаша: армированное ПВХ: 0,4 мм</li>\r\n<li>Песчаный фильтр-насос: 2006л/ч (# 58271), 220-240V, 50Hz, 90W</li>\r\n<li>Кварцевый песок в комплект не входит</li>\r\n<li>Лестница 4-х ступенчатая из прочного пластика высотой,см: 122(# 58097)</li>\r\n<li>Комплект подающей форсунки и скиммера</li>\r\n<li>Сливной клапан</li>\r\n<li>Цвет: светло-серый</li>\r\n<li>Время установки,ч: 3</li>\r\n<li>Упаковка: Цветная коробка</li>\r\n<li>Габариты упаковки,см: 77х162.5х52</li>\r\n<li>Вес,кг: 109.3</li>\r\n</ul>', NULL, NULL, 0, 'foladis karkasuli auzi BestWay ', '', 0, 0, '/files/ფოლადის_კარკასული_აუზი_BestWay_56574.jpg', '/files/ფოლადის_კარკასული_აუზი_BestWay_56574_1.jpg', '/files/ფოლადის_კარკასული_აუზი_BestWay_56574_2.jpg', '/files/ფოლადის_კარკასული_აუზი_BestWay_56574_3.jpg', '/files/ფოლადის_კარკასული_აუზი_BestWay_56574_4.jpg', '/files/ფოლადის_კარკასული_აუზი_BestWay_56574_5.jpg', 0, NULL, NULL, 0, NULL),
