(482, 164, 0, 61102, '', 1, NULL, '2023-06-27 08:45:51', 164, 'ru', 18, 1, 'Надувная лодка BestWay  61102', 'Надувная лодка BestWay ', '97.00', NULL, '<p>Лодка надувная Bestway Hydro Force 61102 - прекрасно подойдет любителю активного отдыха, а также ценителю рыбалки. Лодка имеет высокую грузоподъемность, благодаря чему может вместить на себе до 4 человек. В комплекте с лодкой идет прочная заплатка для ремонта.<br><em><strong>Характеристика:</strong></em><br>- Предохранительные клапаны;<br>- Материал: Прочный испытанный Винил;<br>- Повышенный комфорт за счет надувного дна;<br>- Встроенный люверс с буксировочным шнуром;<br>- Прочные уключины;<br>- Весла длинной 124 см.;<br>- Ручной насос размером 30 см.<br><em><strong>В Комплекте:</strong></em><br>- Лодка;<br>- Два весла;<br>- Один надувной насос;<br>- Ремонтная заплата. </p>', NULL, NULL, 0, 'gasaberi navi BestWay ', '', 0, 0, '/files/გასაბერი_ნავი_BestWay_61102_(Hydro-Force_Raft_Set)_22.jpg', '/files/გასაბერი_ნავი_BestWay_61102_(Hydro-Force_Raft_Set)_23.jpg', '/files/გასაბერი_ნავი_BestWay_61102_(Hydro-Force_Raft_Set)_10.jpg', '/files/გასაბერი_ნავი_BestWay_61102_(Hydro-Force_Raft_Set)_11.jpg', '/files/გასაბერი_ნავი_BestWay_61102_(Hydro-Force_Raft_Set)_14.jpg', '/files/გასაბერი_ნავი_BestWay_61102_(Hydro-Force_Raft_Set)_15.jpg', 0, NULL, NULL, 0, NULL);
