(491, 167, 0, 58242, '', 1, NULL, '2023-06-27 08:45:51', 167, 'ru', 7, 1, 'Солнечный тент для бассейна Bestway  58242', 'Солнечный тент для бассейна Bestway ', '65.00', NULL, '<p style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 20px; padding: 0px; box-sizing: content-box; color: #333333; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Тент сохраняет воду чистой, служит для поддержания температуры воды и препятствует испарению. Увеличивает эффективность работы нагревателей. Уменьшает процент теплопотери. Рекомендуется накрывать бассейн тентом на все время, пока бассейн не используется. Также в тенте имеется дренажные отверстия для предотвращения скопления воды и повреждения тента.</p>\r\n<ul style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 27px; padding: 0px; box-sizing: content-box; transition: background-color 0.1s ease 0s; color: #333333; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">\n<li style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 4px; padding: 0px 0px 0px 20px; box-sizing: content-box; list-style-type: none; position: relative;\">Подходит к: круглым бассейнам диаметром 366-396 см;</li>\r\n<li style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 4px; padding: 0px 0px 0px 20px; box-sizing: content-box; list-style-type: none; position: relative;\">Диаметр тента: 356 см;</li>\r\n<li style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 4px; padding: 0px 0px 0px 20px; box-sizing: content-box; list-style-type: none; position: relative;\">Цвет: Тёмно-синий;</li>\r\n<li style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 4px; padding: 0px 0px 0px 20px; box-sizing: content-box; list-style-type: none; transition: background-color 0.1s ease 0s; position: relative;\">Время уставновки: до 5 минут;</li>\r\n<li style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 4px; padding: 0px 0px 0px 20px; box-sizing: content-box; list-style-type: none; position: relative;\">Материал: Полиэтилен 0,20 мм - термопластичный прозрачный полимер;</li>\r\n<li style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 4px; padding: 0px 0px 0px 20px; box-sizing: content-box; list-style-type: none; position: relative;\">Дренажные отверстия для преотвращения скопления воды на поверхности;</li>\r\n<li style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 4px; padding: 0px 0px 0px 20px; box-sizing: content-box; list-style-type: none; position: relative;\">Другие особенности: гидроизоляция (вода, грязь), устойчивый к УФ, мобильный и легкий.</li>\r\n</ul>\n<h3 style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 30px 0px 16px; padding: 0px; box-sizing: content-box; color: #383838; line-height: 20px; font-weight: 500; font-size: 20px; text-align: left; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Особенности:</h3>\r\n<ul style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 27px; padding: 0px; box-sizing: content-box; color: #333333; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">\n<li style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 4px; padding: 0px 0px 0px 20px; box-sizing: content-box; list-style-type: none; position: relative;\">Эффективная технология «Солнечной линзы»:</li>\r\n<li style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 4px; padding: 0px 0px 0px 20px; box-sizing: content-box; list-style-type: none; position: relative;\">воздушная прослойки в виде “пузырьков” удерживает тепло, делает испарение воды минимальным;</li>\r\n<li style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 4px; padding: 0px 0px 0px 20px; box-sizing: content-box; list-style-type: none; position: relative;\"> пузырьки служат “линзами”, проводят солнечные лучи, нагревают воду.</li>\r\n<li style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px 0px 4px; padding: 0px 0px 0px 20px; box-sizing: content-box; list-style-type: none; position: relative;\"><span style=\"font-family: Ubuntu, Arial, Helvetica, sans-serif; margin: 0px; padding: 0px; box-sizing: content-box; text-decoration: underline;\">Внимание! У теплосберегающего тента не креплений. Он должен ложиться на воду как одеяло, не касаясь бортов бассейна.</span></li>\r\n</ul>', NULL, NULL, 0, 'auzis gadasafarebeli mzis mtsuravi tenti BestWay ', '', 0, 0, '/files/აუზის_გადასაფარებელი_მზის_მცურავი_ტენტი_BestWay_58242.jpg', '/files/აუზის_გადასაფარებელი_მზის_მ