(500, 170, 0, 65001, '', 1, NULL, '2023-06-27 08:45:51', 170, 'ru', 18, 1, 'Надувная лодка BestWay  65001', 'Надувная лодка BestWay ', '590.00', NULL, '<p>Эта лодка является идеальным выбором для тех, кто считает себя настоящим моряком – отдельного внимания заслуживает её повышенная безопасность - Voyager 500,состоит из нескольких воздушных независимых камер и специального надувного пола, предназначенного для большей упругости и комфорта. Эта модель создана из высокопрочного винила Super-Tough, устойчивого к воздействию соленой воды, масел, бензина, а также к различным механическим повреждениям.                                                                                                                   Лодка надувная Вояджер-500<br>- нейлоновый шнур вдоль бортов<br>- надувное дно<br>- удобная многофункциональная сумка в комплекте<br>- надувное дно и надувные сидения<br>- кольца для фиксации крепления лодочного мотора (мотор и крепление в комплект не входят)<br>- прочные ручки для переноски<br>- держатели для удочек<br>- надёжные уключины<br>- клипсы для фиксации вёсел<br>- кольцо для крепления буксировочного шнура<br>- алюминиевые вёсла 145 см в комплекте<br>- прочная заплатка для ремонта в комплекте<br>Размер в надутом состоянии: 348х142 см, Грузоподъёмность 253 кг<br>Пассажировместимость: 3 взрослых</p>', NULL, NULL, 0, 'gasaberi navi BestWay ', '', 0, 0, '/files/გასაბერი_ნავი_BestWay_65001_11.jpg', '/files/გასაბერი_ნავი_BestWay_65001_12.jpg', '/files/გასაბერი_ნავი_BestWay_65001_14.jpg', '/files/გასაბერი_ნავი_BestWay_65001_15.jpg', '/files/გასაბერი_ნავი_BestWay_65001_16.jpg', '/files/გასაბერი_ნავი_BestWay_65001_17.jpg', 0, NULL, NULL, 0, NULL),
(501, 171, 0, 68010, '', 1, NULL, '2023-06-24 16:24:04', 171, 'ru', 19, 1, 'Туристическая палатка BestWay  (Plateau) 68010', 'Туристическая палатка BestWay  (Plateau)', '99.00', NULL, '<p>Провести время на природе с комфортом Вам поможет кемпинговая палатка. Такая палатка легко устанавливается, а в собранном виде не занимает много места. Вместительность палатки 3 человека. Палатка оборудована москитной сеткой для защиты от насекомых. Кемпинговая палатка имеет один слой, материал ― полиэстер. Герметичные швы не позволяют влаге проникнуть вовнутрь палатки. Внутри палатки имеется карман для хранения мелких вещей. Для удобства хранения и переноски палатки в комплекте имеется удобный чехол.    </p>\r\n<ul>\n<li>вместимость 3 человека;</li>\r\n<li>размеры внешние 210х210х130 см;</li>\r\n<li>размер спальни 210х210х130 см;</li>\r\n<li>водостойкость 300 мм вод. столба;</li>\r\n<li>материал тента ― полиэстер 170Т;</li>\r\n<li>материал спальни ― полиэстер 170Т;</li>\r\n<li>материал пола ― нейлон;</li>\r\n<li>материал каркаса ― фибергласс.</li>\r\n</ul>', NULL, NULL, 0, '', '', 0, 0, '', '', '', '', '', '', 0, NULL, NULL, 0, NULL),
