(537, 183, 0, 67483, '', 1, NULL, '2023-06-27 08:45:51', 183, 'ru', 2, 1, 'Надувная кровать софа BestWay  67483', 'Надувная кровать софа BestWay ', '229.00', NULL, '<p><span class=\"bold\">Надувная кровать Bestway 67483</span></p>\r\n<p>Высокая двухместная кровать 67483 способствует максимальному отдыху и комфорту. У кровати есть удобная спинка и встроенный электро-насос. Установка кровати не занимает никаких особых усилий. Изготовлена из высококачественных материалов и не теряет своей формы даже после многоразового использования. Для транспортировки кровати к комплект входит специальная дорожная сумка.</p>\r\n<p><span class=\"bold\">Характеристики:</span></p>\r\n<ul>\n<li>Тип: кровать</li>\r\n<li>Количество мест: двухместные</li>\r\n<li>Размер: 226х152х74 см</li>\r\n<li>Комплектация: встроенный насос, дорожная сумка</li>\r\n</ul>', NULL, NULL, 0, 'gasaberi logini BestWay ', '', 0, 0, '/files/გასაბერი_ლოგინი_BestWay_67483__Soft-Back_Elevated_Airbed(Queen)_15.jpg', '/files/გასაბერი_ლოგინი_BestWay_67483__Soft-Back_Elevated_Airbed(Queen)_4.jpg', '/files/გასაბერი_ლოგინი_BestWay_67483__Soft-Back_Elevated_Airbed(Queen)_5.jpg', '/files/გასაბერი_ლოგინი_BestWay_67483__Soft-Back_Elevated_Airbed(Queen)_7.jpg', '/files/გასაბერი_ლოგინი_BestWay_67483__Soft-Back_Elevated_Airbed(Queen)_8.jpg', '/files/გასაბერი_ლოგინი_BestWay_67483__Soft-Back_Elevated_Airbed(Queen)_9.jpg', 0, NULL, NULL, 0, NULL);
