(540, 184, 0, 67381, '', 1, NULL, '2023-06-27 08:45:51', 184, 'ru', 2, 1, 'Надуввная кровать BestWay  67381', 'Надуввная кровать BestWay ', '129.00', NULL, '<p><strong>Bestway 67381 </strong>Одноместная надувная кровать с электрическим насосом.</p>\r\n<p>Надувная кровать <em><strong>Bestway 67381</strong></em>, позволит расположится на ночлег максимально удобно и комфортно. Кровать Bestway 67381 изготовлена из прочного устойчивого к бытовым повреждениям материала. Поверхность кровати <em>Bestway 67381</em> покрыта слоем флока , по своим характеристикам напоминающем велюр, благодаря чему постельное белье не будет соскальзовать с кровати во время сна. Благодаря встроенному насосу, данная кровать надувается за считанные минуты, что сохранит Ваши силы и время. <strong>Bestway 67381</strong> Отличный подарок в любой дом.к</p>\r\n<h3>Характеристики Bestway 67381:</h3>\r\n<ul>\n<li>Цвет: Чёрный</li>\r\n<li>Насос: Отдельный 220 В.</li>\r\n<li>Материал: ПВХ с флокированным покрытием</li>\r\n<li>Максимальная нагрузка: вес в 273 кг.</li>\r\n<li>В комплект входит: надувная кровать, насос 220В, сумка.</li>\r\n</ul>\n<p>Размеры:</p>\r\n<p>191х97х46 см</p>\r\n<p>Вес: 6.1 kg</p>', NULL, NULL, 0, 'gasaberi logini BestWay ', '', 0, 0, '/files/გასაბერი_ლოგინი_BestWay_67381__Premium_Air_Bed_with_Sidewinder-_Ac_Air_Pump(Single)_23.jpg', '/files/გასაბერი_ლოგინი_BestWay_67381__Premium_Air_Bed_with_Sidewinder-_Ac_Air_Pump(Single)_7.jpg', '/files/გასაბერი_ლოგინი_BestWay_67381__Premium_Air_Bed_with_Sidewinder-_Ac_Air_Pump(Single)_8.jpg', '/files/გასაბერი_ლოგინი_BestWay_67381__Premium_Air_Bed_with_Sidewinder-_Ac_Air_Pump(Single)_9.jpg', '/files/გასაბერი_ლოგინი_BestWay_67381__Premium_Air_Bed_with_Sidewinder-_Ac_Air_Pump(Single)_10.jpg', '/files/გასაბერი_ლოგინი_BestWay_67381__Premium_Air_Bed_with_Sidewinder-_Ac_Air_Pump(Single)_12.jpg', 0, NULL, NULL, 0, NULL),
