(552, 188, 0, 67492, '', 1, NULL, '2023-06-27 08:45:51', 188, 'ru', 2, 1, 'Надуввная кровать BestWay  67492', 'Надуввная кровать BestWay ', '198.00', NULL, '<p><strong>Надувная кровать Bestway 67492</strong> имеет встроенный электрический насос на 220V , что позволит надуть кровать в кратчайшие сроки: около 4 минут. <br>Надувная кровать подарит Вам полноценный отдых дома и загородом.<br>Кровать изготовлена по новейшим технологиям, верхняя часть сделана из прочного водонепроницаймого велюра, который не допустит соскальзования постельного белья.<br>Усиленная конструкция придаёт особую жесткость и устойчивость к деформации.<br><strong>В комплекте:</strong> заплатка для ремонта проколов, инструкция, сумка для переноски и хранения.</p>\r\n<h3>Особенности надувной кровати Bestway 67492:</h3>\r\n<ul>\n<li>материал: винил;</li>\r\n<li>верхняя часть матраса имеет флокированное покрытие.;</li>\r\n<li>встроенный электрический насос 220-240V;</li>\r\n<li>размер кровати: 191х97х43 см.</li>\r\n</ul>', NULL, NULL, 0, 'gasaberi logini BestWay ', '', 0, 0, '/files/გასაბერი_ლოგინი_BestWay_67492_Comfort_Cell_New_Comfort_Raised_Airbed(Single)_31.jpg', '/files/გასაბერი_ლოგინი_BestWay_67492_Comfort_Cell_New_Comfort_Raised_Airbed(Single)_32.jpg', '/files/გასაბერი_ლოგინი_BestWay_67492_Comfort_Cell_New_Comfort_Raised_Airbed(Single)_33.jpg', '/files/გასაბერი_ლოგინი_BestWay_67492_Comfort_Cell_New_Comfort_Raised_Airbed(Single)_34.jpg', '/files/გასაბერი_ლოგინი_BestWay_67492_Comfort_Cell_New_Comfort_Raised_Airbed(Single)_35.jpg', '/files/გასაბერი_ლოგინი_BestWay_67492_Comfort_Cell_New_Comfort_Raised_Airbed(Single)_36.jpg', 0, NULL, NULL, 0, NULL),
