(564, 192, 0, 67173, '', 1, NULL, '2023-06-27 08:45:51', 192, 'ru', 2, 1, 'Надувная подушка BestWay  67173', 'Надувная подушка BestWay ', '9.80', NULL, '<ul>\n<li>Размер подушки, см: 42 x 26 х 10</li>\r\n<li>Форма: четырехугольная</li>\r\n<li>Цвет: синий</li>\r\n<li>Предохранительный клапан: да</li>\r\n<li>Материал: плотный винил</li>\r\n<li>Размер упаковки, см: 12 x 2.5 x 17</li>\r\n<li>Вес упаковки: 0.156кг</li>\r\n</ul>', NULL, NULL, 0, 'gasaberi balishi BestWay ', '', 0, 0, '/files/გასაბერი_ბალიში_BestWay_67173__Fabric_Air_Pillow_2.jpg', '/files/გასაბერი_ბალიში_BestWay_67173__Fabric_Air_Pillow_3.jpg', '/files/გასაბერი_ბალიში_BestWay_67173__Fabric_Air_Pillow_4.jpg', '/files/გასაბერი_ბალიში_BestWay_67173__Fabric_Air_Pillow_5.jpg', '/files/გასაბერი_ბალიში_BestWay_67173__Fabric_Air_Pillow_6.jpg', '', 0, NULL, NULL, 0, NULL),
