(567, 193, 0, 62022, '', 1, NULL, '2023-06-27 08:45:51', 193, 'ru', 7, 1, 'Набор для ремонта бассейна BestWay  62022', 'Набор для ремонта бассейна BestWay ', '5.00', NULL, '<p>Тщательно очистить и просушить ремонтируемую поверхность. Вырезать заплатку нужного размера, из тюбика с клеем нанести нужное количество клея. Сильно прижать заплатку на 5 минут и положить под груз на 10 часов.<br><strong>В наборе:</strong><br>- клей (5 гр.),<br>- ПВХ наклейка (130 см2).</p>', NULL, NULL, 0, 'auzebis shesaketi masala BestWay ', '', 0, 0, '/files/აუზების_შესაკეთი_მასალა_BestWay_62022.jpg', '/files/აუზების_შესაკეთი_მასალა_BestWay_62022_1.jpg', '', '', '', '', 0, NULL, NULL, 0, NULL),
