(570, 194, 0, 62068, '', 1, NULL, '2023-06-27 08:45:51', 194, 'ru', 7, 1, 'Набор для ремонта бассейна BestWay  62068', 'Набор для ремонта бассейна BestWay ', '4.00', NULL, '<p>Ремкомплект предназначен для быстрого ремонта различных надувных изделий из винила, ПВХ и резины. При помощи ремонтного комплекта вы сможете быстро и легко устранить небольшой прокол или порез на надувной матрасе, бассейне, лодке и тд. В комплекте 10 заплаток-самоклеек. </p>', NULL, NULL, 0, 'auzebis shesaketi masala BestWay ', '', 0, 0, '/files/აუზების_შესაკეთი_მასალა_BestWay_62068.jpg', '/files/აუზების_შესაკეთი_მასალა_BestWay_62068_1.jpg', '', '', '', '', 0, NULL, NULL, 0, NULL),
