(573, 195, 0, 62091, '', 1, NULL, '2023-06-27 08:45:51', 195, 'ru', 7, 1, 'Ремонтный набор водостойкий BestWay  62091', 'Ремонтный набор водостойкий BestWay ', '5.00', NULL, '<div class=\"tb_block\" style=\"position: static; padding-top: 7px; margin: 0px 0px 7px; color: #000000; font-family: Tahoma, sans-serif; font-size: 11px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">\r\n<p style=\"text-indent: 0px; margin: 0px 0px 7px;\">Заплатка: 10 шт.<br>Размер: 6.5х6.5 см</p>\r\n</div>\r\n<div class=\"tb_block\" style=\"position: static; padding-top: 7px; margin: 0px 0px 7px; color: #000000; font-family: Tahoma, sans-serif; font-size: 11px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Влагостойкий ремонтный набор от производителя Bestway, используется для ремонта надувных бассейнов, лодок, кроватей, матрасов и других изделий из винила. В набор входят 10 заплаток размером 6.5х6.5 см, также прилагается инструкция по применению.</div>', NULL, NULL, 0, 'tskalgamdzle shesaketi masala BestWay ', '', 0, 0, '/files/წყალგამძლე_შესაკეთი_მასალა_BestWay_62091_2.jpg', '/files/წყალგამძლე_შესაკეთი_მასალა_BestWay_62091_3.jpg', '/files/წყალგამძლე_შესაკეთი_მასალა_BestWay_62091_4.jpg', '', '', '', 0, NULL, NULL, 0, NULL),
