(585, 199, 0, 56475, '', 1, NULL, '2023-06-27 08:45:51', 199, 'ru', 6, 1, 'Каркасный бассейн BestWay  56475', 'Каркасный бассейн BestWay ', '4400.00', NULL, '<p><strong>Каркасный бассейн Bestway 56475 (732х366х132 см)</strong> - это огромный бассейн прямоугольной формы, в нём могут купаться как дети, так и взрослые, чистоту воды будет поддерживать песчаный фильтр, имеющийся в комплекте. <strong>Каркасный бассейн Bestway 56475</strong> представляет собой надёжный и качественный бассейн, состоящий из каркаса и чаши, чаша изготовлена из стойкого к солнечным лучам и механическому воздействию армированного поливинилхлорида, жесткость и устойчивость конструкции обеспечивает каркас, состоящий из стальных труб. Каркасный <strong>бассейн Bestway 56475</strong> это незаменимая вещь в летнюю жару, при желании в нём можно купаться всей семьёй, такой бассейн может быть установлен в любом удобном для вас месте, в комплектацию входит покрытие под бассейн, защитный чехол и металлическая лестница.</p>\r\n<p><strong>Характеристики каркасного бассейна Bestway 56475</strong>:</p>\r\n<ul>\n<li>Форма бассейна: прямоугольная</li>\r\n<li>Объем бассейна (90%): 30045 литров</li>\r\n<li>Размеры бассейна: длина - 732 см, ширина - 366 см, высота - 132 см</li>\r\n<li>Материал чаши: трехслойный ПВХ: два слоя ПВХ и слой стекло-волоконной сетки</li>\r\n<li>Каркас: оцинкованные стальные трубы</li>\r\n<li>Песчаный фильтр</li>\r\n</ul>\n<p>Комплектация каркасного бассейна Bestway 56475:</p>\r\n<ul>\n<li>Лестница</li>\r\n<li>Песчаный фильтр</li>\r\n<li><span style=\"color: #000000; font-family: Ingiri; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !impor