(588, 200, 0, 56405, '', 1, NULL, '2023-06-27 08:45:51', 200, 'ru', 6, 1, 'Каркасный бассейн  BestWay  56405', 'Каркасный бассейн  BestWay ', '670.00', NULL, '<p>Каркасный бассейн BestWay 56405 Splash Frame Pools отличается высокой прочностью и устойчивостью. Чаша выполнена из высококачественного трехслойного ПВХ: два слоя плотного винила и один - полиэстер для особой прочности. Каркас металлический нержавеющий оцинкованный. Не требует бетонирования и подготовки ямы, все, что нужно, это плоская, горизонтальная площадка. Сезонный бассейн (рекомендуется разбирать на холодное время года) обладает простой конструкцией - может быть легко разобран и собран заново. Время сборки и подключения бассейна не более 2-3 часов. Удобный сливной клапан позволяет присоединить садовый шланг, что дает возможность слить воду в любое место.</p>\r\n<ul>\n<li>Размеры бассейна, см: 400x211x81</li>\r\n<li>Объем бассейна: 5700л</li>\r\n<li>Форма: прямоугольный</li>\r\n<li><span class=\"misspell__error misspell__error_type_bold\"><span class=\"misspell__error\">Материал (каркас): оцинкованный металл</span></span></li>\r\n<li>Материал (чаша): 3-х слойный ПВХ           </li>\r\n<li>В комплект входит ремкомплект и DVD-инструкция </li>\r\n<li>Габариты упаковки,см: 36x105x30</li>\r\n<li>Вес,кг: 32</li>\r\n</ul>', NULL, NULL, 0, 'karkasuli auzi BestWay ', '', 0, 0, '/files/კარკასული_აუზი_BestWay_56405.jpg', '/files/კარკასული_აუზი_BestWay_56405___Family_Splash_Frame_Pool_5.jpg', '/files/კარკასული_აუზი_BestWay_56405___Family_Splash_Frame_Pool_6.jpeg', '/files/კარკასული_აუზი_BestWay_56405___Family_Splash_Frame_Pool_8.jpg', '/files/კარკასული_აუზი_BestWay_56405___Family_Splash_Frame_Pool_9.jpg', '/files/კარკასული_აუზი_BestWay_56405___Family_Splash_Frame_Pool_10.jpeg', 0, NULL, NULL, 0, NULL),
