(604, 206, 0, 65051, '', 1, NULL, '2023-06-27 08:45:51', 206, 'ge', 18, 1, 'გასაბერი ნავი BestWay  65051', 'გასაბერი ნავი BestWay ', '349.00', NULL, '<ul>\n<li>ნავის ზომა: 243cm х 102cm x 31cm</li>\r\n<li>ადგილების რაოდენობა: ორი</li>\r\n<li>სამგანყოფილებიანი კონსტრუქცია</li>\r\n<li>შემორტყმული აქვს ნეილონის თოკი</li>\r\n<li>მაქსიმალური ტვირთამწეობა: 170-200kg</li>\r\n<li>მოჰყვება 2 ცალი ალუმინის ნიჩაბი (145cm)</li>\r\n<li>კლიპსები ნიჩბების ფიქსაციისთვის: კი</li>\r\n<li>ანკესების სამაგრები: კი</li>\r\n<li>რბილი გასაბერი ძირი: კი</li>\r\n<li>დამცავი სარქველი: კი</li>\r\n<li>მასალა:  PVC(0.42mm)</li>\r\n<li>შესაკეთი მასალა: კი</li>\r\n<li>შეფუთვის ზომა: 30cm x 16cm x 74.5cm</li>\r\n<li>შეფუთვის წონა: 7.436kg</li>\r\n</ul>\n<p> </p>', NULL, NULL, 0, 'gasaberi navi BestWay ', '', 0, 0, '/files/გასაბერი_ნავი_BestWay_65051_17.jpg', '/files/გასაბერი_ნავი_BestWay_65051_18.jpg', '/files/გასაბერი_ნავი_BestWay_65051_19.jpg', '/files/გასაბერი_ნავი_BestWay_65051_3.jpg', '/files/გასაბერი_ნავი_BestWay_65051_4.jpg', '/files/გასაბერი_ნავი_BestWay_65051_5.jpg', 0, NULL, NULL, 0, NULL),
(605, 206, 0, 65051, '', 1, NULL, '2023-06-27 08:45:51', 206, 'en', 18, 1, 'გასაბერი ნავი BestWay  65051', 'გასაბერი ნავი BestWay ', '349.00', NULL, '<ul>\n<li>ნავის ზომა: 243cm х 102cm x 31cm</li>\r\n<li>ადგილების რაოდენობა: ორი</li>\r\n<li>სამგანყოფილებიანი კონსტრუქცია</li>\r\n<li>შემორტყმული აქვს ნეილონის თოკი</li>\r\n<li>მაქსიმალური ტვირთამწეობა: 170-200kg</li>\r\n<li>მოჰყვება 2 ცალი ალუმინის ნიჩაბი (145cm)</li>\r\n<li>კლიპსები ნიჩბების ფიქსაციისთვის: კი</li>\r\n<li>ანკესების სამაგრები: კი</li>\r\n<li>რბილი გასაბერი ძირი: კი</li>\r\n<li>დამცავი სარქველი: კი</li>\r\n<li>მასალა:  PVC(0.42mm)</li>\r\n<li>შესაკეთი მასალა: კი</li>\r\n<li>შეფუთვის ზომა: 30cm x 16cm x 74.5cm</li>\r\n<li>შეფუთვის წონა: 7.436kg</li>\r\n</ul>\n<p> </p>', NULL, NULL, 0, 'gasaberi navi BestWay ', '', 0, 0, '/files/გასაბერი_ნავი_BestWay_65051_17.jpg', '/files/გასაბერი_ნავი_BestWay_65051_18.jpg', '/files/გასაბერი_ნავი_BestWay_65051_19.jpg', '/files/გასაბერი_ნავი_BestWay_65051_3.jpg', '/files/გასაბერი_ნავი_BestWay_65051_4.jpg', '/files/გასაბერი_ნავი_BestWay_65051_5.jpg', 0, NULL, NULL, 0, NULL),
(606, 206, 0, 65051, '', 1, NULL, '2023-06-27 08:45:51', 206, 'ru', 18, 1, 'Надувная лодка BestWay  65051', 'Надувная лодка BestWay ', '349.00', NULL, '<p><strong>Надувная лодка Bestway Voyager 300</strong> имеет три отсека - независимых. Отсеки имеют клапаны для накачки и сдува воздуха. Основной отсек - внешний, придает лодки форму. Другие два внутренних отсека придают жесткость лодки и обеспечивают безопастность в случае повреждения основного отсека. Надувной пол сделан для удобства находящимся внутри лодки людей.</p>\r\n<p>Лодка имеет две уключины и крепление для весел. На носу лодки предусмотрена пластиковая ручка для спуска лодки на воду и переноса. Вокруг внешнего отсека (основнова) натянута веревка через петли для буксировки лодки и швартования.</p>\r\n<p>Материал лодки Bestway Voyager 300 - трехслойный ПВХ. Первый и третий слой - винил, а второй сетчатый полиэстер.</p>\r\n<h3>Комплектация:</h3>\r\n<ul>\n<li>Клапаны</li>\r\n<li>Два держателя для удочек</li>\r\n<li>Вёсельные уключины</li>\r\n<li>Швартовочная ручка</li>\r\n<li>Внешний леер (страховочный трос)</li>\r\n<li>Прочные алюминиевые вёсла</li>\r\n</ul>\n<h3>Характеристки:</h3>\r\n<ul>\n<li>три независимых воздушных отсека.</li>\r\n<li>технология изготовления SUPER-TOUGH.</li>\r\n<li>количество мест в лодке: 2.</li>\r\n<li>грузоподъемность, до 190 кг.</li>\r\n<li>Размер: 243 × 102 × 40 см.</li>\r\n<li>Вес: 7 кг.</li>\r\n</ul>', NULL, NULL, 0, 'gasaberi navi BestWay ', '', 0, 0, '/files/გასაბერი_ნავი_BestWay_65051_17.jpg', '/files/გასაბერი_ნავი_BestWay_65051_18.jpg', '/files/გასაბერი_ნავი_BestWay_65051_19.jpg', '/files/გასაბერი_ნავი_BestWay_65051_3.jpg', '/files/გასაბერი_ნავი_BestWay_65051_4.jpg', '/files/გასაბერი_ნავი_BestWay_65051_5.jpg', 0, NULL, NULL, 0, NULL);
