(609, 207, 0, 58237, '', 1, NULL, '2023-06-27 08:45:51', 207, 'ru', 7, 1, 'Набор для чистки бассейна BestWay  58237', 'Набор для чистки бассейна BestWay ', '249.00', NULL, '<p style=\"margin: 0px 0px 18px; color: #000000; font-family: Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Для обеспечения качественной чистки не только внутренних стенок бассейна, но также и для удаления крупного мусора производитель INTEX создал многофункциональный набор 58237 для очистки марки Deluxe Bestway. В его составе ручка из алюминия, к которой с легкостью можно присоединить любую из насадок. Всасывающая насадка, присоединяющаяся с помощью шланга к отверстию фильтра в резервуаре, применяется для зачистки налета дна и стен, а также для ликвидации донного мусора.</p>\r\n<p style=\"margin: 0px 0px 18px; color: #000000; font-family: Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Собранная загрязненная вода попадает в специальный отсек (листва, ветки, трава осядут в нем), далее вода без видимых крупных частиц пропускается скиммером, происходит более глубокая очистка, и выходит обратно в резервуар. Также скиммер можно использовать и отдельно, в качестве постоянной самостоятельной фильтрации поверхности. Такая комплектация чистящего оборудования может быть использована для бассейна диаметром более 4,5 м.</p>\r\n<p style=\"margin: 0px 0px 18px; color: #000000; font-family: Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><strong style=\"font-weight: bold;\">Характеристики:</strong></p>\r\n<p><span style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">• Мощность: 3000 л/ч;</span><br style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"color: #000000; font-family: Arial, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 