(630, 214, 0, 65350, '', 1, NULL, '2023-06-27 08:45:51', 214, 'ru', 18, 1, 'Надувная доска для SUP серфинга Bestway  65350', 'Надувная доска для SUP серфинга Bestway ', '1890.00', NULL, '<p>Доска для САП серфинга 65350- SUP-борд - это плавающая доска, схожа по своему внешнему виду с доской для серфинга. Управляется при помощи специального весла с длинной рукояткой. <br>Надувная доска для плавания SUP-БОРД – оптимальный выбор для начинающих и опытных плавников. Она идеально подходит для длительных водных прогулок, а также для парусного спорта, серфинга и морского каякинга.<br><br>Благодаря наличию шнура органайзера для удобной укладки личных вещей, можно брать достаточное количество багажа, так как грузоподъемность SUP доски Bestway 65350 составляет до 120 кг. Таким образом, можно смело отправляться в путешествие и сплав по реке.<br><br>Надувная SUP доска Bestway 65350 - универсальная (All-around) доска, которую можно использовать для катания и на гладкой воде, и на небольших волнах, на короткие и длинные расстояния.<br><br>Сап доска Bestway  65343 (305х84х12 см), ручной насос, весло, страховочный трос (лиш) , сумка, до 120 кг - это высочайшее качество изготовления, машинная спайка слоев, под давлением! НЕ РУЧНАЯ СКЛЕЙКА! Тщательный контроль на всех этапах производства. Каждая доска проходит испытания в надутом состоянии, чтобы исключить возможные дефекты. Современные высокотехнологичные южнокорейские материалы, которые позволяют выполнить доску по двухслойной технологии, используя облегченный ПВХ. Надувные SUP доски устойчивы к порезам, проколам различным загрязнениям.<br><br>Доска максимально безопасна, поскольку имеет вторую камеру, которая накачивается отдельно от основной. Даже в случае прокола одной из камер вы сможете оставаться на плаву. А фактурный рисунок на коврике придаст вам устойчивости при нахождении на ней как стоя, так и сидя.<br><br>Краска не стирается при механическом воздействии, соленой воде и ярком солнце.</p>\r\n<p>   • Размер: 305x84x12см<br>   • Количество мест: 1<br>   • Грузоподъемность: до 120 кг.<br>   • Насос: Да, ручной насос с манометром Air Hammer<br>   • Весло: Универсальное весло-трансформер 217 см<br>   • Сумка для транспортировки: Да<br>   • Вес - 15кг<br>   • Давление (max) - 15 psi<br> Комплектация:<br>   • SUP-доска<br>   • Регулируемое и разборное алюминиевое весло трансформер<br>   • Ручной насос<br>   • Страховочный трос (лиш)<br>   • Съемный плавник (киль)<br>   • Сумка<br>   • Ремкомплект для быстрого ремонта</p>', NULL, NULL, 0, 'gasaberi dafa saf bordingistvis Bestway ', '', 0, 0, '/files/გასაბერი_დაფა_საფ_ბორდინგისთვის_Bestway_65303_1.jpg', '/files/გასაბერი_დაფა_საფ_ბორდინგისთვის_Bestway_65303_2.jpg', '/files/გასაბერი_დაფა_საფ_ბორდინგისთვის_Bestway_65303_3.jpg', '/files/გასაბერი_დაფა_საფ_ბორდინგისთვის_Bestway_65303_9.jpg', '/files/გასაბერი_დაფა_საფ_ბორდინგისთვის_Bestway_65303_10.jpg', '/files/გასაბერი_დაფა_საფ_ბორდინგისთვის_Bestway_65303_11.jpg', 0, NULL, NULL, 0, NULL),
