(657, 223, 0, 58195, '', 1, NULL, '2023-06-27 08:45:51', 223, 'ru', 7, 1, 'Набор для чистки бассейна BestWay  58195', 'Набор для чистки бассейна BestWay ', '120.00', NULL, '<div class=\"item_bookmark_wrap\">\r\n<div id=\"item_tabs\" class=\"ui-tabs ui-widget ui-widget-content ui-corner-all\">\r\n<div class=\"item_tab\">\r\n<div id=\"description\" class=\"ui-tabs-panel ui-widget-content ui-corner-bottom\">\r\n<div class=\"extdescr17\">\r\n<ul>\n<li>Данный набор поможет вам без труда поддерживать бассейн в чистоте.</li>\r\n<li>Также набор будет служить для контроля за температурой воды в бассейне, уровнем pH и хлора.</li>\r\n</ul>\n<strong>В набор входят:</strong>\r\n<ul>\n<li>Держатель длиной 172см.</li>\r\n<li>Насадка с щеткой уборки мусора под водой.</li>\r\n<li>Сачок для уборки мусора с поверхности воды..</li>\r\n<li>Дозатор плавающий для химии (таблетки в комплект не входят).</li>\r\n<li>Термометр.</li>\r\n<li>Тестовые полоски для определения хлора и уровня pH в воде (50 шт).</li>\r\n<li>Ремкомплект из 10-ти клейких заплаток на случай повреждения пленки бассейна.</li>\r\n</ul>\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"for_print p10_0\">Фирма-производитель оставляет за собой право на внесение изменений в конструкцию, дизайн и комплектацию приборов без предварительного уведомления. Во избежание недоразумений при покупке приборов уточняйте информацию о комплектации, наличию и цене у продавцов. Вся информация на сайте носит справочный характер и не является публичной офертой.</div>', NULL, NULL, 0, 'satsmendi nakrebi auzistvis BestWay ', '', 0, 0, '/files/საწმენდი_ნაკრები_აუზისთვის_BestWay_58195_Pool_Accessories_Set.jpg', '/files/საწმენდი_ნაკრები_აუზისთვის_BestWay_58195_Pool_Accessories_Set_1.jpg', '/files/საწმენდი_ნაკრები_აუზისთვის_BestWay_58195_Pool_Accessories_Set_2.jpg', '/files/საწმენდი_ნაკრები_აუზისთვის_BestWay_58195_Pool_Accessories_Set_3.jpg', '/files/_230.jpg', '', 0, NULL, NULL, 0, NULL),
