(660, 224, 0, 67496, '', 1, NULL, '2023-06-27 08:45:51', 224, 'ru', 2, 1, 'Детская надувная кровать Bestway  с проектором 67496', 'Детская надувная кровать Bestway  с проектором', '89.00', NULL, '<p><strong>Детская надувная кровать Bestway 67496 с проектором</strong> и бортиками — отличная новая модель уютного спального места для малышей для полноценного отдыха и здорового, спокойного сна.  Кровать с односпальным местом состоит из проектора, светящегося звездным ночным небом, что используют в качестве ночника.  Кровать покрыта флоковым напылением, которое мягкое и приятное на ощупь.  Постельное белье не скользит и равномерно ложиться на кровать. Достаточно высокие бортики кровати предают абсолютную безопасность малышу во время сна.  Надувается кровать быстро и легко за 2-3 минуты при использовании насоса любого типа.</p>\r\n<p>Особенности надувной кровати Bestway 67496 с проектором:</p>\r\n<ul>\n<li>размер: 137cm х 46cm х 76cm;</li>\r\n<li>максимальная нагрузка: 50kg;</li>\r\n<li>материал: винил;</li>\r\n<li>материал покрытия: флок;</li>\r\n<li>сумка для переноски и хранения в комплекте.</li>\r\n</ul>', NULL, NULL, 0, 'sabavshvo gasaberi logini proeqtorit Bestway ', '', 0, 0, '/files/საბავშვო_გასაბერი_ლოგინი_პროექტორით_Bestway_67496.jpg', '/files/საბავშვო_გასაბერი_ლოგინი_პროექტორით_Bestway_67496_1.jpg', '/files/საბავშვო_გასაბერი_ლოგინი_პროექტორით_Bestway_67496_2.jpg', '/files/საბავშვო_გასაბერი_ლოგინი_პროექტორით_Bestway_67496.jpeg', '/files/საბავშვო_გასაბერი_ლოგინი_პროექტორით_Bestway_67496_3.jpeg', '/files/საბავშვო_გასაბერი_ლოგინი_პროექტორით_Bestway_67496_4.jpeg', 0, NULL, NULL, 0, NULL),
(661, 225, 0, 56424, '', 1, NULL, '2023-06-27 08:45:51', 225, 'ge', 6, 1, 'კარკასული აუზი BestWay  56424', 'კარკასული აუზი BestWay ', '770.00', NULL, '<ul>\n<li>აუზის ზომა, სმ: 400x211x81</li>\r\n<li>წყლის ტევადობა(90%): 5700ლ</li>\r\n<li>ფორმა: მართკუთხედი</li>\r\n<li>ფერი: ლურჯი</li>\r\n<li>წყლის დამცლელი სარქველი: კი</li>\r\n<li>კარკასის მასალა: უჟანგავი ლითონი</li>\r\n<li>აუზის მასალა: არმირებული PVC(პოლივინილქლორიდი)</li>\r\n<li>შეფუთვის ზომა, სმ: 39х105х30</li>\r\n<li>შეფუთვის წონა: 33.5კგ </li>\r\n</ul>\n<p>კომპლექტში შედის:</p>\r\n<ul>\n<li>კარტრიჯული ფილტრი-ნასოსი(800ლ/ს), 220V</li>\r\n<li>კარტრიჯი</li>\r\n<li>შესაკეთი მასალა</li>\r\n<li>ინსტრუქცია</li>\r\n</ul>', NULL, NULL, 0, 'karkasuli auzi BestWay ', '', 0, 0, '/files/კარკასული_აუზი_BestWay_56424.jpg', '/files/კარკასული_აუზი_BestWay_56424_Family_Splash_Frame_Pool_Set_1.jpg', '/files/კარკასული_აუზი_BestWay_56424_Family_Splash_Frame_Pool_Set_4.jpeg', '/files/კარკასული_აუზი_BestWay_56424_Family_Splash_Frame_Pool_Set_7.jpg', '/files/კარკასული_აუზი_BestWay_56424_Family_Splash_Frame_Pool_Set_8.jpg', '/files/კარკასული_აუზი_BestWay_56424_Family_Splash_Frame_Pool_Set_5.jpeg', 0, NULL, NULL, 0, NULL),
