(701, 238, 0, 60015, '', 1, NULL, '2023-06-27 08:45:51', 238, 'ru', 8, 1, 'Надувной Spa бассейн BestWay  Lay Z Spa Ibiza AirJet 60015', 'Надувной Spa бассейн BestWay  Lay Z Spa Ibiza AirJet', '2500.00', NULL, '<div class=\"tb_block\" style=\"position: static; padding-top: 7px; margin: 0px 0px 7px;\">Надувной СПА бассейн (джакузи) Lay-Z-Spa Ibiza AirJet от производителя Bestway представляет собой надувшую чашу квадратной формы, которая вмещает в себя до шести человек. Данная модель мобильна и практична в использовании. Например, вы можете расположить бассейн во дворе частного дома или в больших помещениях с влагоустойчивой облицовкой.<br><br>Управление осуществляется с помощью кнопок на панели, размещенной на электрическом насосе. На ЖК-дисплее наглядно отображаются рабочие параметры. С помощью таймера можно задавать удобное время запуска программ. Покупка Lay-Z-Spa Ibiza AirJet будет отличной альтернативной идеей дорогостоящим салонам.</div>\r\n<p><span style=\"color: #000000; font-family: Tahoma, sans-serif; font-size: 11px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><strong class=\"h2 panel\">Особенности:</strong></span></p>\r\n<div class=\"tb_block\" style=\"position: static; padding-top: 7px; margin: 0px 0px 7px;\">• Мягкий пол<br>• Фильтрация воды<br>• Нагрев воды<br>• Функция аэромассажа<br>• Функция предотвращающая замерзание воды<br>• Удобная система управления<br>• Массажная система<br>• Компактное хранение</div>\r\n<div class=\"complectation\" style=\"position: static; margin: 0px 0px 7px; color: #000000; font-family: Tahoma, sans-serif; font-size: 11px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">\n<strong>Комплектация:</strong>\r\n<ul style=\"margin-top: 10px; padding-left: 15px;\">\n<li style=\"margin-bottom: 3px;\">СПА-бассейн</li>\r\n<li style=\"margin-bottom: 3px;\">Защитная крышка-чехол</li>\r\n<li style=\"margin-bottom: 3px;\">Электрический насос/нагреватель с панелью управления</li>\r\n<li style=\"margin-bottom: 3px;\">Система аэро-массажа</li>\r\n<li style=\"margin-bottom: 3px;\">Фильтр-картридж тип VI</li>\r\n<li style=\"margin-bottom: 3px;\">Плавающий дозатор химии</li>\r\n<li style=\"margin-bottom: 3px;\">Ремкомплект</li>\r\n<li style=\"margin-bottom: 3px;\">Инструкция по эксплуатации</li>\r\n</ul>\n</div>', NULL, NULL, 0, 'gasaberi djakuzi BestWay  Lay Z Spa Ibiza AirJet', '', 0, 0, '/files/გასაბერი_Spa_აუზი_BestWay_54291.jpg', '/files/გასაბერი_Spa_აუზი_BestWay_54291_1.jpg', '/files/გასაბერი_Spa_აუზი_BestWay_54291_2.jpg', '/files/გასაბერი_Spa_აუზი_BestWay_54291_3.jpg', '/files/გასაბერი_Spa_აუზი_BestWay_54291_4.jpg', '/files/გასაბერი_Spa_აუზი_BestWay_54291_5.jpg', 0, NULL, NULL, 0, NULL),
