(775, 263, 0, 32032, '', 1, NULL, '2023-06-27 08:45:51', 263, 'ru', 12, 1, 'Доска для плавания Bestway  32032', 'Доска для плавания Bestway ', '17.00', NULL, '<p>        <span style=\"color: #000000; font-family: Arial; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Универсальная доска для плавания от производителя Bestway, которая предназначена для отработки техники ног. Данная модель имеет достаточную прочность и малый вес. Доск<span style=\"color: #000000; font-family: Arial; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">у</span> для плавания Bestway 32032 можно использовать и в бассейне, и на открытой воде. С помощью доски для плавания Kick Board ребенок быстро и без страха сможет научиться плавать и держаться на воде. Доска выполнена из легкого высокоплотного пенопласта. </span></p>\r\n<ul style=\"list-style-type: undefined;\">\n<li>Размер, см: 43 x 30</li>\r\n<li>Форма: доска</li>\r\n<li>Цвет: желтый</li>\r\n<li>Возраст: 3-6 лет</li>\r\n<li>Материал: пенопласт</li>\r\n<li>Вес упаковки: 0.1264кг</li>\r\n</ul>', NULL, NULL, 0, 'satsurao dafa Bestway ', '', 0, 0, '/files/საცურაო_დაფა_Bestway_32032_Swim_Safe.jpeg', '/files/საბავშვო_საცურაო_დაფა_Bestway_32032_Swim_Safe_5.jpeg', '/files/საბავშვო_საცურაო_დაფა_Bestway_32032_Swim_Safe_2.jpeg', '/files/საბავშვო_საცურაო_დაფა_Bestway_32032_Swim_Safe_3.jpeg', '/files/საბავშვო_საცურაო_დაფა_Bestway_32032_Swim_Safe_4.jpeg', '', 0, NULL, NULL, 0, NULL),
