(781, 265, 0, 52201, '', 1, NULL, '2023-06-27 08:45:51', 265, 'ru', 21, 1, 'Детский игровой домик палатка Bestway  52201', 'Детский игровой домик палатка Bestway ', '53.00', NULL, '<p>      Детский игровой домик-палатка \"Звер<span style=\"color: #000000; font-family: \'Open Sans\', sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">ю</span>шки\" - мечта каждого ребёнка. Ведь в нём можно создать свой сказочный мир, почитать любимые книжки, поиграть или даже принять гостей. С собственным домиком малыш почувствует себя более самостоятельным.<br>      Изделие имеет вход и окно для удобного наблюдения. Благодаря красочному рисунку оно легко впишется в любую игру и станет её незаменимым атрибутом. Установите домик в квартире или на заднем дворе дачи, благодаря прочному материалу изделие оградит ребёнка от солнечных лучей.</p>\r\n<ul style=\"color: #000000; font-family: Ingiri; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #d3f3ff; text-decoration-style: initial; text-decoration-color: initial;\">\n<li>Размер, см: 102 x 76 x 114</li>\r\n<li>Форма: домик</li>\r\n<li>Цвет: разноцветный, яркий</li>\r\n<li>Материал прочный винил</li>\r\n<li>Возраст: от 2-6 лет</li>\r\n<li>Размер упаковки, см: 50.5 x 5 x 21.5</li>\r\n<li>Вес упаковки: 1.256кг</li>\r\n</ul>', NULL, NULL, 0, 'sabavshvo satamasho sakhli kravi Bestway ', '', 0, 0, '/files/_89.jpeg', '/files/_90.jpeg', '/files/_91.jpeg', '/files/_92.jpeg', '/files/_93.jpeg', '/files/_94.jpeg', 0, NULL, NULL, 0, NULL),
