(811, 275, 0, 58259, '', 1, NULL, '2023-06-27 08:45:51', 275, 'ru', 7, 1, 'Нагреватель для бассейна Bestway  58259', 'Нагреватель для бассейна Bestway ', '400.00', NULL, '<p>Электронагреватель Bestway 58259 - отличное решение для нагрева воды в пасмурную погоду в каркасных и надувных бассейнах объемом от 1 600 до 17 000 литров (диаметром не более 457 см). Оно присоединяется к насосу-фильтру (мощностью до 3785 л/ час) и начинает нагревать воду. Подходит для бассейнов Intex и Bestway.<br> Для ускорения процесса нагрева, бассейн можно накрыть тентом. При работе нагревателя температура воды в бассейне повышается на 0,5-1,5 градусов в час. Скорость нагрева зависит от погодных условий, температуры воздуха и воды. Для повышения эффективности устройства рекомендовано оснастить бассейн специальным теплосберегающем тентом. Максимальная температура нагрева воды составляет 40°С. Стоит использовать данное изделие при температуре воды не ниже 16 градусов и не выше 35 градусов.</p>\r\n<p><em><strong>Подходит для песочных и картриджных фильтров, т.е. для работы нагревателя необходима циркуляция воды, без фильтр-насоса использование невозможно!</strong></em></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Категорически запрещается использовать нагреватель, когда в бассейне находятся люди!</strong></span><br>    Характеристики:</p>\r\n<p>• Артикул производителя: 58259<br> • Диапазон задаваемой t, °C: 16-35<br> • Производительность: примерное время для увеличения температуры на 1 градус (1°C):<br> • Объем воды ~1900 л:  около 1 ч;<br> • Объем воды ~3750 л:  около 2,5 ч;<br> • Объем воды ~5680 л:  около 3 ч;<br> • Объем воды ~7500 л:  около 4 ч;<br> • Объем воды ~9460 л:  около 6 ч;<br> • Объем воды ~11350 л:  около 7 ч;<br> • Объем воды ~13250 л:  около 8 ч;<br> • Объем воды ~17000 л:  около 10 ч;</p>\r\n<p>• Диаметр шлангов, мм: 32<br> • Длина шланга, м: 1,5<br> • Напряжение: 220В<br> • Панель управления: мембрана с кнопками<br> • Длина кабеля, м: 4<br> • Потребляемая мощность, кВт