(832, 282, 0, 68087, '', 1, NULL, '2023-06-27 08:45:51', 282, 'ru', 19, 1, 'Палатка четырехместная туристическая Bestway  68087', 'Палатка четырехместная туристическая Bestway ', '257.00', NULL, '<p>Четырехместная палатка Bestway 68087 Cool Mount изготовлена из огнезащитного и водонепроницаемого материала. Однослойная, не имеет тента. Обтекаемая структура обеспечивает устойчивость палатки в ветреную погоду.<br>Оснащена внутренним карманом для хранения личных вещей.<br>Полуавтоматическая, очень легко раскладывается и складывается. Рассчитана на 4 человек.<br>Палатка походная, характеристики:<br>• Внутренний карман для хранения личных вещей;<br>• Обтекаемая структура обеспечивает устойчивость при ветре;<br>• Высокая плотность материала;<br>• Огнезащитная ткань;<br>• Однослойная палатка (не имеет тента, внешнего слоя): <br>• Простота конструкции и установки;<br>• Минимальное место для установки;<br>• Материал: ткань 190T полиэстер с покрытием PU300mm:<br>• Водонепроницаемость: 2000 мм водяного столба<br>• Тип сборки:  полуавтоматическая<br>• Водонепроницаемые швы<br>• Количество мест: 4-х местная;<br>• Размер: 240 х 210 х 100 см;<br>• Размер (спального места): 240 х 210 см;<br>• Вес: 2.3 кг.</p>', NULL, NULL, 0, 'otkh katsiani karavi Bestway ', '', 0, 0, '/files/ოთხ_კაციანი_კარავი_Bestway_68087_12.jpg', '/files/ოთხ_კაციანი_კარავი_Bestway_68087_1.jpg', '/files/ოთხ_კაციანი_კარავი_Bestway_68087_2.jpg', '/files/ოთხ_კაციანი_კარავი_Bestway_68087_3.jpg', '/files/ოთხ_კაციანი_კარავი_Bestway_68087_5.jpg', '/files/ოთხ_კაციანი_კარავი_Bestway_68087_6.jpg', 0, NULL, NULL, 0, NULL),
