(844, 286, 0, 65304, '', 1, NULL, '2023-06-27 08:45:51', 286, 'ru', 18, 1, 'Надувная доска для SUP серфинга Bestway  65304', 'Надувная доска для SUP серфинга Bestway ', '1690.00', NULL, '<p>Надувная доска SUP-борд, Bestway 65304. Сапбординг(SUP) расшифровывается как Stand Up Paddle (с английского «гребля стоя») - разновидность серфинга. Кататься по воде без больших волн на доске стоя или на коленях и гребя одним веслом - очень просто. Быстро освоить SUP борд может даже ребенок. Требуется соблюдать технику безопасности, привязываться ремнем ногу к доске, который идет в комплекте. Спереди и сзади - металлические кольца для швартовки и ремня безопасности. Снизу есть киль для более прямолинейного движения по воде.</p>\r\n<ul>\n<li>Размер доски: 305см х 84см x 15см</li>\r\n<li>max нагрузка: 130кг</li>\r\n<li>Цвет доски: голубой</li>\r\n<li>Материал: Super Tough(половинилхлорид)</li>\r\n<li>Размер упаковки см: 40см x 25см x 90см</li>\r\n<li>Вес упаковки: 15.105кг</li>\r\n</ul>\n<p>Комплектация:</p>\r\n<ul>\n<li>Страховочный поводок</li>\r\n<li>Рем. комплект</li>\r\n<li>Надувная доска</li>\r\n<li>Рюкзак</li>\r\n<li>Насос</li>\r\n<li>Весло</li>\r\n</ul>', NULL, NULL, 0, 'gasaberi dafa saf bordingistvis Bestway ', '', 0, 0, '/files/გასაბერი_დაფა_საფ_ბორდინგისთვის_Bestway_65304.jpg', '/files/გასაბერი_დაფა_SUP_სერფინგისთვის_Bestway_65304__10.jpeg', '/files/გასაბერი_დაფა_SUP_სერფინგისთვის_Bestway_65304__11.jpeg', '/files/გასაბერი_დაფა_SUP_სერფინგისთვის_Bestway_65304__13.jpeg', '/files/გასაბერი_დაფა_SUP_სერფინგისთვის_Bestway_65304__14.jpeg', '/files/გასაბერი_დაფა_SUP_სერფინგისთვის_Bestway_65304__15.jpeg', 0, NULL, NULL, 0, NULL),
