(893, 303, 0, 58230, '', 1, NULL, '2023-06-27 08:45:51', 303, 'ru', 7, 1, 'Погружной дренажный насос Bestway  58230', 'Погружной дренажный насос Bestway ', '190.00', NULL, '<p style=\"margin: 8px 0px; font-size: 13px; padding: 0px; border: 0px; color: #444444; font-family: Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Дренажный насос Bestway является идеальным инструментом, для того чтобы избавиться от воды в бассейне, когда бассейн не используется. Вместо того, чтобы черпать воду по крупицам, насос обеспечит максимальную производительность 3028 л/час, чтобы слить воду из бассейна автоматически и удобно.</p>\r\n<ul style=\"margin: 8px 0px; padding: 0px 20px; list-style: outside none none; font-size: 13px; border: 0px; color: #444444; font-family: Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">\n<li style=\"font-size: 13px; margin: 0px; padding: 0px; border: 0px;\">• Перекачивает 3028 л (800 галлонов) в час</li>\r\n<li style=\"font-size: 13px; margin: 0px; padding: 0px; border: 0px;\">• Входное напряжение: 220-240 V</li>\r\n<li style=\"font-size: 13px; margin: 0px; padding: 0px; border: 0px;\">\n<span style=\"color: #202124; font-family: arial, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">• Степень защиты</span>: IPX8</li>\r\n<li style=\"font-size: 13px; margin: 0px; padding: 0px; border: 0px;\">• Мощность: 80W</li>\r\n<li style=\"font-size: 13px; margin: 0px; padding: 0px; border: 0px;\">• Износостойкая конструкция</li>\r\n<li style=\"font-size: 13px; margin: 0px; padding: 0px; border: 0px;\">• Коррозионно-стойкий материал</li>\r\n<li style=\"font-size: 13px; margin: 0px; padding: 0px; border: 0px;\">• Очень длинный сливной шланг длиной 5,00 м, диаметром 3,2 см</li>\r\n<li style=\"font-size: 13px; margin: 0px; padding: 0px; border: 0px;\">• СЕРТИФИКАТЫ TUV/GS/CEL:  EMC/LVD</li>\r\n<li style=\"font-size: 13px; margin: 0px; padding: 0px; border: 0px;\">• В комплект входят два переходника для подсоединения шланга</li>\r\n</ul>', NULL, NULL, 0, 'auzidan tsklis amosatumbi drenajuli tumbo Bestway ', '', 0, 0, '/files/აუზიდან_წყლის_ამოსატუმბი_დრენაჟული_ტუმბო_Bestway_58230_13.jpg', '/files/აუზიდან_წყლის_ამოსატუმბი_დრენაჟული_ტუმბო_Bestway_58230_14.jpg', '/files/აუზიდან_წყლის_ამოსატუმბი_დრენაჟული_ტუმბო_Bestway_58230_15.jpg', '/files/აუზიდან_წყლის_ამოსატუმბი_დრენაჟული_ტუმბო_Bestway_58230_16.jpg', '/files/აუზიდან_წყლის_ამოსატუმბი_დრენაჟული_ტუმბო_Bestway_58230_17.jpg', '/files/აუზიდან_წყლის_ამოსატუმბი_დრენაჟული_ტუმბო_Bestway_58230_18.jpg', 0, NULL, NULL, 0, NULL),
