(916, 311, 0, 65096, '', 1, NULL, '2023-06-27 08:45:51', 311, 'ru', 18, 1, 'Надувная лодка BestWay  65096', 'Надувная лодка BestWay ', '790.00', NULL, '<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #374250; font-family: RobotoLight; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Надувная лодка \"BestWay 65096 Marine Pro\" размером 291 х 127 х 46 см из материала повышенной прочности. Оснащена двумя независимыми воздушными камерами и надувным полом, что обеспечивает комфорт и безопасность. Есть крепления для мотора и держатели для удочек. В комплекте алюминиевые весла длиной 152 см и ручной насос двойного действия. Выдерживает нагрузку до 270 кг и поставляется в комплекте с двумя надувными подушками. Лодка сделана из специального высокопрочного винила, который устойчив к воздействию бензина, масел, соленой воды, а также к механическим повреждениям.</p>\r\n<ul style=\"box-sizing: border-box; margin-top: 5px; margin-bottom: 10px; color: #374250; font-family: RobotoLight; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">\n<li style=\"box-sizing: border-box;\">Размеры: 291 х 127 х 46 см</li>\r\n<li style=\"box-sizing: border-box;\">Колличество мест: 3</li>\r\n<li style=\"box-sizing: border-box;\">Максимальная нагрузка: 270 кг</li>\r\n<li style=\"box-sizing: border-box;\">Воздушные камеры: 2</li>\r\n<li style=\"box-sizing: border-box;\">Материал: армированный ПВХ 0.75 мм</li>\r\n<li style=\"box-sizing: border-box;\">Прочная ручка из винила</li>\r\n<li style=\"box-sizing: border-box;\">Держатели для удочек</li>\r\n<li style=\"box-sizing: border-box;\">Трос по периметру лодки для швартовки и буксировки</li>\r\n<li style=\"box-sizing: border-box;\">Надувной пол</li>\r\n<li style=\"box-sizing: border-box;\">Надувные сиденья</li>\r\n<li style=\"box-sizing: border-box;\">Уключины с каждой стороны и держатели для вёсел</li>\r\n<li style=\"box-sizing: border-box;\">Усиленные крепления под транец для мотора</li>\r\n<li style=\"box-sizing: border-box;\">Алюминиевые весла длиной 152 см</li>\r\n<li style=\"box-sizing: border-box;\">Ручной насос двойного действия (накачивание происходит при движении поршня в обоих направлениях)</li>\r\n<li style=\"box-sizing: border-box;\">Вес: 15.9 кг</li>\r\n</ul>', NULL, NULL, 0, 'gasaberi navi BestWay ', '', 0, 0, '/files/გასაბერი_ნავი_BestWay_65096.jpg', '/files/გასაბერი_ნავი_BestWay_65096_1.jpg', '/files/გასაბერი_ნავი_BestWay_65096_2.jpg', '/files/გასაბერი_ნავი_BestWay_65096_3.jpg', '/files/გასაბერი_ნავი_BestWay_65096_4.jpg', '/files/გასაბერი_ნავი_BestWay_65096_5.jpg', 0, NULL, NULL, 0, NULL),
